// src/pages/Profile.js
import React from 'react';

const Welcome = () => {
  return (
    <div className="profile-page">
      <h2>Рады видеть Вас снова!</h2>
      <p>Добро пожаловать в ваш профиль!</p>
    </div>
  );
};

export default Welcome;
